  false,\n\t\"url\": null,\n\t\"notes\": \"The 1995 Water Management Plan for Muscatatuck
  NWR begins by summarizing the 1994 Water Management Program. Management results
  for moist soil units, green tree units, lakes, ponds, and marshes are given. Waterfowl
  management is also outlined. The 1995 plan includes the completion of the McDonald
  Marsh Restoration Project. Wetland management, maintenance, and construction for
  1995 are described. Climatic data for 1994, annual MSU evaluations, water use data,
  and impoundment planning forms are given in the appendices.\",\n\t\"license_title\":
